import React, { Component } from 'react';

class Company extends Component {
  constructor(props) {
    super(props);
    this.state = {
      employees: [
        {
          Name: 'eduk',
          Address: 'bgc',
          Description: 'enk'
        },
        {
          Name: 'next',
          Address: 'remote',
          Description: 'wuho'
        },
        {
          Name: 'rt',
          Address: 'dela rosa',
          Description: 'mmm'
        },
        {
          Name: 'io',
          Address: 'pacific',
          Description: 'boo'
        },
      ]
    };
  }
  render(){
    return (
      <div>
        <h1>Company</h1>
        <h3>Welcome to NF Company Management System</h3>
      </div>
    );
  }
}

export default Company
